import React, { useState } from 'react';
import axios from 'axios';

const Flows = () => {
  const [appId, setAppId] = useState('');
  const [appDetails, setAppDetails] = useState(null);
  const [error, setError] = useState('');

  const fetchAppDetails = async () => {
    try {
      const response = await axios.get(`http://localhost:8080/apps/${appId}`);
      setAppDetails(response.data);
      setError('');
    } catch (error) {
      setError('Error fetching app details');
    }
  };

  return (
    <div>
      <h1>Fetch Facebook App Details</h1>
      <input
        type="text"
        placeholder="Enter App ID"
        value={appId}
        onChange={(e) => setAppId(e.target.value)}
      />
      <button onClick={fetchAppDetails}>Fetch Details</button>
      {error && <p>{error}</p>}
      {appDetails && (
        <div>
          <h2>App Details</h2>
          <p>App Name: {appDetails.name}</p>
          <p>Category: {appDetails.category}</p>
          {/* Display other details as needed */}
        </div>
      )}
    </div>
  );
};

export default Flows;
